import React from 'react'
import './clients.css'
import {hello} from 'modules/hover'

class Client extends React.Component{
    componentDidMount(){
        alert("Client")
    }
    render(props){
        return(
            <div className="client">
            <img onMouseOver={hello} src={this.props.img} alt="" />
        </div>
        )
    }
}


// const Client = (props) => {
